import Layout from '../components/Layout';
import CardsContainer from '../components/CardsContainer';

const index = () => {
  const toDo = {
    title: 'esto es un to do',
    description: ""
  }
  return (
    <>
      <Layout title="Home">
        <CardsContainer toDo="To Do index" />
      </Layout>

      <style jsx global>
        {`
          * {
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </>
  );
};

export default index;
